import React from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
} from "recharts";

const NutritionDashboard = ({ calories, macros, mealPlan }) => {
  // ...existing code...
  return (
    <div className="p-4 bg-white rounded-lg shadow-lg">
      <h2 className="text-xl font-bold mb-2">Your Nutrition Dashboard</h2>
      <div className="mb-4">
        <span className="font-semibold">Calories per day:</span> {calories} kcal
      </div>
      <div className="mb-4">
        <span className="font-semibold">Macronutrient Breakdown:</span>
        <ResponsiveContainer width="100%" height={200}>
          <BarChart data={macros}>
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="value" fill="#60a5fa" />
          </BarChart>
        </ResponsiveContainer>
      </div>
      <div>
        <span className="font-semibold">Meal Plan Suggestions:</span>
        <ul className="list-disc ml-6">
          {mealPlan.map((meal, idx) => (
            <li key={idx}>{meal}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default NutritionDashboard;
